import React from 'react';
import {Menu,Input} from 'semantic-ui-react';

export default ()=> {
  return (
    <Menu>
        <Menu.item>
          首页
        </Menu.item>

        <Menu.Menu position='right'>
          <Menu.Item>
            <Input icon='search' placeholder='Search...' />
          </Menu.Item>
          <Menu.Item name='logout'  />
        </Menu.Menu>

    </Menu>

  );
}
